import styled from "styled-components"
import Card from "../components/Card";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import { Latest_newVideo,Yummylicious,Dicover_restaurants,Amazing_superheroes, Latest_newVideo_heading,Yummylicious_heading } from "../data"

const Container=styled.div`

`

const Home = () => {
  return (
    <Container>
      <Navbar />

      <Card contents={{Latest_newVideo,Latest_newVideo_heading}}/>
      <Card contents={{Yummylicious,Yummylicious_heading}}/>
      <Card contents={{Dicover_restaurants}}/>
      <Card contents={Amazing_superheroes}/> 
      <Footer />
    </Container>
  )
}

export default Home
